import React, { useState, useEffect } from "react";

const CounterComponent: React.FC = React.memo(() => {
  const [count, setCount] = useState<number>(0);

  useEffect(() => {
    console.log(`Count изменился: ${count}`);

    return () => {
      console.log("Компонент будет обновлен или размонтирован.");
    };
  }, [count]);

  useEffect(() => {
    console.log("Компонент смонтирован.");

    return () => {
      console.log("Компонент размонтирован.");
    };
  }, []);

  const incrementCount = () => {
    setCount(count + 1);
  };

  const resetCount = () => {
    setCount(0);
  };

  return (
    <div>
      <h2>Counter Component</h2>
      <p>Количество кликов: {count}</p>
      <button onClick={incrementCount}>Увеличить</button>
      <button onClick={resetCount}>Сбросить</button>
    </div>
  );
});

export default CounterComponent;
